import React, { Component } from 'react';

class App extends Component {
    state = {}
    render() {
        return (
            <div>
                <h1>Hello</h1>
            </div>
        );
    }
}

export default App;



class Register extends Component {
    state = {
        username: '',
        password: '',
    }

    async handleSubmit(event) {
        event.preventDefault();
        try {
            const response = await axiosInstance.post('/user/create/', {
                username: this.state.username,
                email: this.state.email,
                password: this.state.password
            });
            return response;
        } catch (error) {
            console.log(error.stack);
            this.setState({
                errors: error.response.data
            });
        }
    }

    handleChange(event) {
        this.setState({ [event.target.name]: event.target.value });
    }

    render() {
        return (
            <form onSubmit={this.handleSubmit}>
                <input name='email' type='email' value={email} onChange={this.handleChange} placeholder='email'></input>
                <input name='username' type='text' value={username} onChange={this.handleChange} placeholder='username'></input>
                <input name='password' type='password' value={password} onChange={this.handleChange} placeholder='password'></input>
                <button type='submit'></button>
            </form>
        );
    }
}
